import React,{Component} from "react";
import "../../scss/components/__sendnotification.scss";


class Send extends Component {
    render(){
        return(
            <div>
                <div className="notification-wrapper">
                  <div className="Selectusers">
                     <ul>
                         <p>User</p>
                         <p>Select</p>
                         <p>
                         <input type="checkbox" name="users" value="Bike"/> Select All </p>
                     </ul>
                  </div>


                </div>
            </div>
        )
    }

};

export default Send;
